        if(currentPos+fragment.getCharCount()>buf.length()){
            throw new IllegalArgumentException("buffer size is smaller than the sum of the lengths of all fragments");
        }
        buf.delete(currentPos,currentPos+fragment.getCharCount());
        currentPos+=fragment.getCharCount();
